transforms.result:
@use 'sass:map';

@use 'mixins/mixins' as *;
@use 'common/var' as *;

@include b(table-column) {
  @include m(selection) {
    .cell {
      padding-left: 14px;
      padding-right: 14px;
    }
  }
}

@include b(table-filter) {
  border: solid 1px getCssVar('border-color-lighter');
  border-radius: 2px;
  background-color: $color-white;
  box-shadow: map.get($dropdown, 'menu-box-shadow');
  box-sizing: border-box;

  /** used for dropdown mode */
  @include e(list) {
    padding: 5px 0;
    margin: 0;
    list-style: none;
    min-width: 100px;
  }

  @include e(list-item) {
    line-height: 36px;
    padding: 0 10px;
    cursor: pointer;
    font-size: getCssVar('font-size', 'base');

    &:hover {
      background-color: map.get($dropdown, 'menuItem-hover-fill');
      color: map.get($dropdown, 'menuItem-hover-color');
    }

    @include when(active) {
      background-color: getCssVar('color-primary');
      color: $color-white;
    }
  }

  @include e(content) {
    min-width: 100px;
  }

  @include e(bottom) {
    border-top: 1px solid getCssVar('border-color-lighter');
    padding: 8px;

    button {
      background: transparent;
      border: none;
      color: getCssVar('text-color', 'regular');
      cursor: pointer;
      font-size: getCssVar('font-size-small');
      padding: 0 3px;

      &:hover {
        color: getCssVar('color-primary');
      }

      &:focus {
        outline: none;
      }

      &.is-disabled {
        color: getCssVar('disabled-text-color');
        cursor: not-allowed;
      }
    }
  }

  @include e(wrap) {
    max-height: 280px;
  }

  @include e(checkbox-group) {
    padding: 10px;

    label.#{$namespace}-checkbox {
      display: flex;
      align-items: center;
      margin-right: 5px;
      margin-bottom: 12px;
      margin-left: 5px;
      height: unset;
    }

    .#{$namespace}-checkbox:last-child {
      margin-bottom: 0;
    }
  }
}

:root {
  --el-color-primary: #fff;
  --el-bg-color-overlay:transparent;
}

/* Element Chalk Variables */
.el-table-column--selection .cell {
  padding-left: 14px;
  padding-right: 14px;
}

.el-table-filter {
  background-color: #fff;
  border: 1px solid var(--el-border-color-lighter);
  border-radius: 2px;
  box-shadow: var(--el-box-shadow-light);
  box-sizing: border-box;
  /** used for dropdown mode */
}
.el-table-filter__list {
  list-style: none;
  margin: 0;
  min-width: 100px;
  padding: 5px 0;
}

.el-table-filter__list-item {
  cursor: pointer;
  font-size: var(--el-font-size-base);
  line-height: 36px;
  padding: 0 10px;
}
.el-table-filter__list-item:hover {
  background-color: var(--el-color-primary-light-9);
  color: var(--el-color-primary);
}
.el-table-filter__list-item.is-active {
  background-color: var(--el-color-primary);
  color: #fff;
}

.el-table-filter__content {
  min-width: 100px;
}

.el-table-filter__bottom {
  border-top: 1px solid var(--el-border-color-lighter);
  padding: 8px;
}
.el-table-filter__bottom button {
  background: transparent;
  border: none;
  color: var(--el-text-color-regular);
  cursor: pointer;
  font-size: var(--el-font-size-small);
  padding: 0 3px;
}
.el-table-filter__bottom button:hover {
  color: var(--el-color-primary);
}
.el-table-filter__bottom button:focus {
  outline: none;
}
.el-table-filter__bottom button.is-disabled {
  color: var(--el-disabled-text-color);
  cursor: not-allowed;
}

.el-table-filter__wrap {
  max-height: 280px;
}

.el-table-filter__checkbox-group {
  padding: 10px;
}
.el-table-filter__checkbox-group label.el-checkbox {
  align-items: center;
  display: flex;
  height: unset;
  margin-bottom: 12px;
  margin-left: 5px;
  margin-right: 5px;
}
.el-table-filter__checkbox-group .el-checkbox:last-child {
  margin-bottom: 0;
}
